import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

const Privacy = () => (
  <Box sx={{ maxWidth: 600, mx: 'auto', my: 6, px: 2 }}>
    <Typography variant="h4" sx={{ fontWeight: 700, mb: 2 }}>
      プライバシーポリシー
    </Typography>
    <Typography sx={{ fontSize: 15, color: '#444', mb: 2 }}>
      本サービス（AIゴルフクラブ診断β版）は、ユーザーのプライバシーを尊重し、個人情報の保護に努めます。
    </Typography>
    <Typography sx={{ fontSize: 14, color: '#666', mb: 2 }}>
      ※本ページはダミーです。正式なプライバシーポリシー文をここに掲載してください。
    </Typography>
    <Typography sx={{ fontSize: 13, color: '#888' }}>
      1. 本サービスは、サービス向上のためにアクセス解析等を行う場合があります。<br />
      2. 取得した情報は、法令に基づく場合を除き、第三者に提供しません。<br />
      3. その他、個人情報の取り扱いについては本ページにて随時告知します。
    </Typography>
  </Box>
);

export default Privacy;
